import React from 'react';
import './index.css'
import Header from "./components/Header/header";
import Nav from "./components/Header/nav";

import 'antd/dist/antd.css'
import Banner from "./components/banner/banner";
import FenleiNav from "./components/fenleiNav";
import Index from "./components/xinpin";
import Release from "./components/xinpin/release";
import XiaomiList from "./components/xiaomiList/xiaomiList";
import Footer from "./components/footer/footer";
import IndexRouter from "./components/routers/indexRouter";
import {Route, Switch} from "react-router";
import GoodsDetail from "./components/goodsDetail/goodsDetail";




function App() {
  return (
    <div className="App">
       <Header/>
       <Nav/>
       <div className={'body'}>
           <Banner/>
           <FenleiNav/>
           <Index/>
           <Release/>
           <XiaomiList/>
           <Footer/>


       </div>
        {/*<IndexRouter/>*/}
        <Switch>
            <Route path={'/goodsDetail'} component={GoodsDetail}/>
        </Switch>
    </div>
  );
}

export default App;
